import React, { useState } from 'react';
import Selector from '../forms/FunctionalSelector.js';

export default function SwellHeightSelector(id, swellHeight, handleSwell1Height, handleSwell2Height) {
    // Declare a new state variable, which we'll call "height"
    console.log(`id: ${JSON.stringify(id, 2, null)}`);
    const [height, setHeight] = useState(swellHeight); 
    return <Selector
            groupTitle={`SwellHeight${id}`}
            selected={height} 
            label="Height" 
            items={[
                "",
                "1ft",
                "2ft",
                "3ft",
                "4ft",
                "5ft",
                "6ft",
                "7ft",
                "8ft",
                "9ft",
                "10ft",
                "11ft",
                "12ft",
                "13ft",
                "14ft",
                "15ft",
                "16ft",
                "17ft",
                "18ft"
            ]}
            onChange={(id === 1) ? handleSwell1Height : handleSwell2Height}
        />
}
